// Suggested transfer function F(z): (T = 0.05 sec, D = 0.5, w0 = 10 / sec)
// 0.25
// F(z) = —---------------------
// 1.75 z^2 -2.5 z + 1 K = 1; // Proportional gain
T = 0.05; // Time step
D = 0.5; // Damping (decay of the oscillation)
w0 = 10; // Characteristic Frequency t = [0:T:4];
input_step = ones(1, length(t)); // step input
input_ramp = t; // ramp input
input_noise = rand(1, length(t)); // noise input // choose input signal
u = input_step; // Simulation of real system
