// y(t) = K u [ 1 - (1 / sqrt(1 - D^2)) * e^(-D*w0*t) * sin(w0*sqrt(1 - D^2)*t + arccos(D)]
y = K*u.*(1 - (1/sqrt(1 - D^2)) .* exp(-D*w0.*t) .* sin(w0*sqrt(1 - D^2).*t + acos(D))); // Using laplace Transfer Function F(s) = K*(w0^2 / s^2 + 2*D*w0*s + w0^2)
s = poly(0, 's'); pt2 = w0^2 / (s^2 + 2*D*w0*s + w0^2);
