yc = csim(u, t, f_s); subplot(2, 1, 1)
plot(t, y)
plot(t, yc, "r.") h1 = legend(['y';'yc-laplace'], 4)
title("Real system") Real System graph First we find second order system in Z-domain by bilinear transformation. We also determine the system order. Then, we simulate the system in Z-domain. // discrete time simulation
