pt2_d = w0^2 / (s^2 + 2*D*w0*s + w0^2); function [order, num_r, den_r] = system_order_determination(eqn) num_r = roots(eqn.num) den_r = roots(eqn.den) n = length(num_r) d = length(den_r) if n >= d then order = n else order = d end for i = 1:n for j = 1:d if num_r(i) == den_r(j) order = order - 1 end end end
