//plot(t, ymod); RLS console NOTE : From y_inf it is clear that we are unable to find parameters as \( (X^T X)^{-1} \) matrix is nearly singular. y_inf should be 1 as time approaches infinity for a PT2 system. Using recursive least squares method to solve the problem. // Implementing the method rescursive least squares and plot of the shape of the parameter determination function
alpha = 100
m = size(X, 1)
l = size(X, 2)
S = alpha*eye(m, m)
Theta_hat = zeros(m, l) // Algorithm
for k = 1:m-1 for i = 1:l gamma_func(k, i) = (1/(X(k+1, i)'*S(k)*X(k+1, i) + 1))*S(k)*X(k+1, i); Theta_hat(k+1, i) = Theta_hat(k, i) + gamma_func(k, i)*(y_meas(k+1) - X(k+1, i)'*Theta_hat(k, i)); S(k+1) = (eye(1, 1) - gamma_func(k, i)*X(k+1, i)')*S(k); end
end for k = 2:m a0(k) = Theta_hat(k, 1); a1(k) = Theta_hat(k, 2); b0(k) = Theta_hat(k, 3); b1(k) = Theta_hat(k, 4); b2(k) = Theta_hat(k, 5); Num = [b2*z^2 + b1*z + b0]; Den = [z^2 + a1*z + a0]; F_mod = syslin('d', Num(k), Den(k)); y2mod(k) = flts(u(k), tf2ss(F_mod));
end plot(t(n:n+N-1), y2mod', "b");
h2 = legend(['yd';'recursive parameter estimation'], 4) We can use RLS method with Exponential Forgetting to better trace the original graph. Instead of 5th point on this step-by-step solution , run the following commands . // Implementing the method rescursive least squares and plot of the shape of the parameter determination function
alpha = 100
m = size(X, 1)
l = size(X, 2)
S = alpha*eye(m, m)
Theta_hat = zeros(m, l) // Variable for exponential forgetting
lambda = 0.1 // Algorithm
for k = 1:m-1 for i = 1:l gamma_func(k, i) = (1/(X(k+1, i)'*S(k)*X(k+1, i) + lambda))*S(k)*X(k+1, i); Theta_hat(k+1, i) = Theta_hat(k, i) + gamma_func(k, i)*(y_meas(k+1) - X(k+1, i)'*Theta_hat(k, i)); S(k+1) = (eye(1, 1) - gamma_func(k, i)*X(k+1, i)')*S(k)*(1/lambda); end
